import Link from 'next/link';
import Header from '../components/Header'
import Head from 'next/head';



function HomePage() {
    return (

      <div>

    <Header/>


    <style jsx>{`
        h1,
        a {
          font-family: 'Arial';
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
      </div>
    )
  }

  export default HomePage
